import React from "react";
import { BsCheck2Square } from "react-icons/bs";


function CompleteIcon(props) {
    return <><BsCheck2Square
        className={`Icon Icon__check ${props.completed && "Icon__check--active"}`}
        onClick={props.onComplete} /><p className={`TodoItem__p  ${props.completed && "TodoItem__p--complete"}`}>
            {props.text}
        </p></>
}

export {CompleteIcon};
